var axios = require('axios');

const GetOperadores = (idcliente) => {

var data = '{\n\n"id_cliente": "amazon|amzn1.account.AHG4S7Q35E4KB5DZGK6BENXDZ6IQ6"\n\n}';

var config = {
  method: 'post',
  url: 'https://fl8vvup0y0.execute-api.us-east-1.amazonaws.com/dev/getcarrier',
  headers: { 
    'Content-Type': 'text/plain'
  },
  data : data
};

axios(config)
.then(function (response) {
  var respuesta = JSON.stringify(response.data);
  return respuesta;
})
.catch(function (error) {
  console.log(error);
});

};

export default GetOperadores
